import React, { Component } from "react";

class Counter extends Component {
  state = {
    count: 1,
    tags: ["tag1", "tag2", "tag3"]
  };

  handleIncremnet() {
    console.log("yo");
  }
  renderTags() {
    if (this.state.tags.length === 0) return <p> no tags to render </p>;

    return (
      <div>
        <button onClick={this.handleIncremnet}></button>
        <ul>
          {this.state.tags.map(tag => (
            <li key={tag}>{tag}</li>
          ))}
        </ul>
      </div>
    );
  }
  render() {
    return <React.Fragment>{this.renderTags()}</React.Fragment>;
  }
}

export default Counter;
